import puzzlePicture from "./Home/puzzleSmall.jpg"

const PuzzleViewer = () => {
    return (
        <div>
            <div style={textAlign= "Center"}>
                <img src={puzzlePicture}/>
            </div>
        </div>
    );
}

export default PuzzleViewer;
